sys_variable_value.value:
(function execute(inputs, outputs) {
    outputs.contianer_name = inputs.contianer_name.trim();

    if (inputs.public_access_policy == "private") {
        outputs.public_access_policy = "";
    } else {
        outputs.public_access_policy = inputs.public_access_policy;
    }

})(inputs, outputs);

